import React from 'react';
import './Projects.css';

function Projects() {
    return(
        <div className="projects">
            <text><span>{name}</span></text>
            <text><span>{desc}</span></text>
            <text><span><a href={url} target="_blank">Github Link</a></span></text>
        </div>
    );
}

export default Projects;
